import React from "react";
import Soapbox from "../images/soapbox.png";
import Footer from "../images/footer.png";

import { Grid, Container } from "@material-ui/core";

function Foot() {
  return (
    <div>
      <Container maxWidth="xl">
        <h1>hello </h1>
      </Container>
      <div container>
        <Grid item sm={4} xs={12}>
          <img className="image-section" src={Soapbox} alt="Logo" />
          <img className="image-section" src={Footer} alt="Logo" />
        </Grid>
        <Grid item sm={4} xs={12}>
          <h1>hello </h1>
        </Grid>
        <Grid item sm={4} xs={12}>
          <h1>hello </h1>
        </Grid>
      </div>
    </div>
  );
}

export default Foot;
